import React from 'react';
import "./news_partners.scss"
const PartnerNews = ({data}) => {
    return (
        <div  className="news_part hidden duration-700 ease-in-out" data-carousel-item>
            <div className="news_part_img">
                <div className="news_part_img1">
                    <img src={data[3]}/>
                </div>
            </div>
            <div className="title_news">
                <img src={data[2]}/>
                <div className="partner">
                    <div className="partner_name">{data[0]}
                    </div>
                    <div className="partner_desc">{data[1]}
                    </div>
                </div>
            </div>
        </div>
    );
};

export default PartnerNews;
